<script>
  function showOnGithub(d) {
    const url = "https://github.com/llvm/llvm-project/compare/536176721056689d5e9041037c4a786d040e94a5..89de0d8dfbb9a6ff1f8b141ed70b563ecc094878#diff-";
    const relPath = concatPath(d).slice(6 + 1); // account for slash
    window.open(url + md5(relPath), '_blank');
  }

  baobab.arcShapes
    .filter(d => !d.children)
    .style("cursor", "pointer")
    .on("click", d => showOnGithub(d));
</script>

<script>
(function() {
  var regex = /[?&]([^=#]+)=([^&#]*)/g,
      url = window.location.href,
      params = {},
      match;
  while(match = regex.exec(url)) {
    params[match[1]] = match[2];
  }

  if (params["path"]) {
    var path = params["path"].split("/");
    var select = baobab.root;
    for (var i = 1; i < path.length; i++) {
      const child = select.children.find(node => node.data["n"] == path[i]);
      if (child && child["children"])
        select = child
      else
        break;
    }
    selectAsNewRoot(select);
  }
})();
</script>
